var tipuesearch = {"pages": [{'title': 'About', 'text': '課程名稱: 協同產品設計實習 - Collaborative Product Design Practice \n 學員作業網站:  https://mdecd2025.github.io/hw-Spirit0224/content/index.html \n 學員作業倉儲:  https://github.com/mdecd2025/hw-Spirit0224 \n \n 課程代號: cd2025 \n Teams 線上教學: \n 以 "學號@nfu.edu.tw" 登入 \xa0 https://login.microsoftonline.com/ \xa0 Office 365 \n Teams 團隊代碼:\xa0 p5z4eku \n \n 課程評分: \n Homework (30%) - 每週至少提交兩次與課程進度有關的內容, 完成後填回自評表單 \n Exam (40%) - 建立包含操作流程影片、心得以及提供檔案下載的網頁後填回自評表單 \n Final Report (30%) - 利用網頁內容進行簡報並提交 pdf 格式書面報告, 完成後填回自評表單 \n \n', 'tags': '', 'url': 'About.html'}, {'title': 'Week', 'text': '', 'tags': '', 'url': 'Week.html'}, {'title': 'w1', 'text': 'Python 更新 \n \n', 'tags': '', 'url': 'w1.html'}, {'title': 'w3', 'text': '列出甲乙兩班未分組的學員 \n # 甲班學員資料處理\nurl = "https://mde.tw/list/2a.txt"\ndata = open(url).readlines()\nall_stud = data[1:]\na_all_members = [\'41223154\', \'41271125\', \'41271158\', \'41271146\', \'41271131\', \'CYG41223103\', \'41223102\', \'41023128\', \'41023137\', \'41223137\', \'41223157\', \'41223156\', \'otakuyoyo\', \'41223141\', \'41223113\', \'kim41223114\', \'joeisme1208\', \'41223116\', \'41223144\', \'41223140\', \'41223143\', \'41223138\', \'41223134\', \'41223136\', \'zhe41223118\', \'Spirit0224\', \'yuhao-08\', \'41223158\', \'Ren911308\', \'41223150\', \'Manto8\', \'CYA41223106\', \'yan21ed\', \'Lin41223107\', \'41223133\', \'hong41223129\', \'41223110\', \'41223147\', \'Linjiahong41223125\', \'CHN41223132\', \'Yu-Fang-Hong\', \'41023111\', \'yckaooooo\', \'kolas911205\', \'41023105\', \'40932134\', \'41223104\', \'yan41223101\', \'41223105\', \'41223153\', \'41223120\', \'41223152\', \'G8People\', \'WSE41223112\', \'41223146\', \'41223119\']\n \n# 顯示甲班標題\nprint("甲班:")\nfor i in all_stud:\n    drop_n = i.rstrip("\\n")\n    stud = drop_n.split("\\t")\n    stud_num = stud[0]\n    stud_github = stud[1]\n    if stud_github not in a_all_members:\n        print(stud_num)\n \n# 乙班學員資料處理\nurl = "https://mde.tw/list/2b.txt"\ndata = open(url).readlines()\nall_stud = data[1:]\nb_all_members = [\'41223251\', \'41223211\', \'41223245\', \'41223243\', \'jjjay41223212\', \'leeshaowei0716\', \'41223234\', \'41223209\', \'41223205\', \'41223201\', \'41223202\', \'41223208-hw\', \'41223216\', \'41223217\', \'41223248\', \'emma0312\', \'41223242\', \'41223203\', \'41223144\', \'41223235\', \'RAY41223215\', \'hyy41223228\', \'41223227\', \'41223206\', \'41223226-0\', \'Cloud41223237\', \'Yujenchuang\', \'41223225\', \'ljg41223220\', \'supowen\', \'jacky93111\', \'41223246\', \'Liu41223244\', \'41223236\', \'41223219\', \'41271237\', \'41223249\', \'41223229\', \'41223224\', \'41223222\', \'41223231\', \'linryan23\', \'41023114\', \'41223230\', \'timluo123\', \'CYC41223247\', \'41223218\', \'ych0227\', \'41023215\', \'41023216\', \'41023213\', \'41071203\', \'41071204\', \'41071202\', \'c-ching\', \'YUN4\', \'tseYU000\', \'snowfall-killer\', \'junpig10\']\n \n# 顯示乙班標題\nprint("\\n乙班:")\nfor i in all_stud:\n    drop_n = i.rstrip("\\n")\n    stud = drop_n.split("\\t")\n    stud_num = stud[0]\n    stud_github = stud[1]\n    if stud_github not in b_all_members:\n        print(stud_num) \n 結果: \n 甲班: 41023220 41223111 41223119 41223124 41223148 \n 乙班: 40923137 41023237 41223210 41223214 41223232 41223233 41223239 41271217 41271236 \n', 'tags': '', 'url': 'w3.html'}, {'title': 'ssh', 'text': '1.利用puttygen.exe建立金鑰，複製ssh-ra到Github，之後到按Load存入Y槽 \n \n 2. \n \n \n \n 操作影片: \n \n \n', 'tags': '', 'url': 'ssh.html'}, {'title': 'w4', 'text': '利用ipv6開啟近端 \n 需改內容 \n \n \n *a後面數值要去按照座號順序輸入 \n \n *IP位置需改成ip6設的ip \n \n *要改成git@後面加你在PUTTY所設定的名稱 \n *在進入網頁前每次需要打git pull來更新進度 \n \n', 'tags': '', 'url': 'w4.html'}, {'title': 'w5', 'text': '電子冰球機器人 \n 動手操作#1 ：雙擊圖示 啟動 Webots \xa0 （或從終端機中的命令列呼叫它）。如果您是第一次在此電腦上執行 Webots，系統可能會提示您選擇圖形主題。您也可能會被邀請參加 Webots 導覽，繼續並關閉導覽。 \n 如果您從未見過，請花一些時間查看導覽中的演示。他們正在講述很多關於 Webot 的可能性。您也可以從 Webots 的 說明 選單取得導覽。 \n 創造新世界 \n 世界是一個文件 ， 其中包含諸如物體在哪裡、它們是什麼樣子、它們如何相互作用、天空是什麼顏色以及重力、摩擦力、物體質量等定義等資訊。它定義了模擬的初始狀態。不同的物件稱為 節點，並在 場景樹 中以層次結構組織。因此，一個節點可能包含子節點。世界儲存在具有 .wbt 副檔名的檔案中。此文件格式源自 VRML97 語言，易於人類閱讀。世界檔案必須直接儲存在名為的目錄中 worlds 。 \n 這裡所說的世界是一個文件文件，其中包含物品所在位置、外觀、以及如何與環境及其他物品互動、天空的顏色與重力、摩擦力、物品品質等資訊。 此外，文件中也定義了模擬的實質狀態。 \n 模擬場景中的各個物件稱為節點，採樹狀架構排列。 其中的節點可以包含子節點。 模擬場景的檔案副檔名為.wbt，奧webots中取wbt三個字母所組成。 此檔案格式源自VRML97語言，內容為明碼，可直接由文字編輯器讀取或編輯。 模擬場景檔案則規定必須能夠在名稱為 worlds 的目錄中儲存。 \n \n 動手操作#2 ：按一下3D 視圖的 Pause 按鈕暫停目前模擬（請參閱 使用者介面說明 以了解按鈕）。如果主工具列上的虛擬時間計數器停止，則模擬將暫停。從 檔案/新建/新專案目錄... 選單項目建立一個新專案並按照說明進行操作： \n \n 命名專案目錄， my_first_simulation 而不是建議的 my_project 。 \n 將世界文件命名 my_first_simulation.wbt 為建議的 empty.wbt 。 \n 點擊所有複選框，包括預設未勾選的“新增矩形競技場”。 \n \n \n Webots 顯示它剛剛建立的目錄和檔案的清單。這對應於 Webots 專案的標準文件層次結構 。按一下 Finish （Windows、Linux）或 Done （macOS）按鈕關閉此視窗。 \n 恭喜，您剛剛創建了您的第一個 Webots 世界！ 3D 視圖應顯示一個帶有方格地板的方形競技場。您可以 使用滑鼠 在 3D 視圖中移動視點：左鍵、右鍵和滾輪。 \n 儲存在世界文件中的 Webot 節點以稱為場景樹的 樹狀結構進行組織。場景樹可以在主視窗的兩個子視窗中查看： 3D 視圖 （位於主視窗的中心）是場景樹的 3D 表示， 場景樹視圖 （左側）是場景樹的層次表示。場景 樹視圖 是可以修改節點和欄位的地方。它目前應該列出以下節點： \n \n WorldInfo ：包含模擬的全域參數。 \n 視點 ：定義主視點相機參數。 \n TexturedBackground ：定義場景的背景（如果稍微旋轉視點，你應該會看到遠處的山脈） \n TexturedBackgroundLight ：定義與上述背景相關的光。 \n RectangleArena ：定義您在該場景中迄今為止看到的唯一物件。 \n \n 每個節點都有一些可自訂的屬性，稱為 字段 。讓我們修改這些欄位來改變矩形區域： \n 每個節點都可以帶有自己設定的屬性，稱為欄位。 \n \n 動手操作#3 ：雙擊 RectangleArena 場景樹中的節點。這應該打開節點並顯示其字段。 (雙點擊各節點可以帶出其特定的欄位) \n \n 選擇該 floorTileSize 欄位並將其值設為 0.25 0.25 而不是 0.5 0.5 。您應該立即在 3D 視圖中看到效果。 \n 選擇該 wallHeight 欄位並將其值變更為 而 0.05 不是 0.1 。競技場的牆壁現在應該更低了。 \n \n \n 在 場景樹視圖 中，如果欄位與預設值不同，則顯示為不同的顏色（取決於主題）。現在，我們想新增一些物件： \n 當欄位值與內定值不同時，將以不同的顏色進行標註。 \n 按shift+鼠標左鍵，可以移動物品。 \n 選擇物體後，可以用Ctrl+C複製該物體，然後用Ctrl+V貼上該複製的物體，然後再用Ctrl+鼠標左鍵移動物體。 \n 物體出現後，出現位於物體中心點的座標指示與旋轉指示，可以用鼠標點選後可以利用指示進行單一方向的移動選擇或利用旋轉指示旋轉物體。 \n \n 動手操作#4 ：雙擊 RectangleArena 場景樹中的以將其關閉並選擇它。點擊場景樹頂部的 Add 按鈕。 在開啟的對話方塊中選擇 PROTO nodes (Webots Projects) / objects / factory / containers / WoodenBox (Solid) 。競技場中央應該會出現一個大箱子。在場景樹中雙擊它以打開其字段。 \n \n 將其改為 size 而 0.1 0.1 0.1 不是 0.6 0.6 0.6 。 \n 將其改為 translation 而 0 0 0.05 不是 0 0 0.3 。或者，您可以使用 3D 視圖中出現的藍色箭頭來調整其 translation.z 場。 \n 現在按住 Shift 鍵並點擊 3D 視圖中的方塊並將其移至競技場的某個角落。 \n 選擇該框並按 ctrl - \xa0 C 、 ctrl - \xa0 V （Windows、Linux）或 ⌘ command - \xa0 C 、 ⌘ command - \xa0 V （macOS）進行複製和貼上。按住 Shift 鍵並按一下並拖曳新方塊以將其移至其他位置。用這種方式建立第三個框。 \n 移動箱子，使沒有箱子位於競技場的中心。您也可以使用藍色旋轉箭頭沿著垂直軸旋轉框。也可以按住 Shift 鍵並按滑鼠右鍵拖曳來完成此操作。或者，您可以變更場景樹中節點 rotation 的場的角度。 WoodenBox \n 一旦您對結果滿意，請使用儲存按鈕儲存世界。 \n \n \n 本節 介紹如何使用平移和旋轉手柄來移動物體。 \n 添加電子冰球機器人 \n e-puck 是一個小型機器人，具有差速輪、10 個 LED 和多個感測器，包括 8 個 距離感測器 和一個 攝影機 。在本教程中，我們只對使用它的輪子感興趣。我們將在接下來的教學中學習如何使用其他功能。 \n 現在，我們將為世界添加一個電子冰球模型。確保模擬已暫停，並且虛擬時間已用時間為 0。如果不是，請使用 Reset 按鈕重設模擬 。 \n 當修改 Webots 世界並打算保存時，首先要暫停模擬並重新載入到其初始狀態，即主工具列上的虛擬時間計數器應顯示 0:00:00:000。否則，每次儲存時，每個 3D 物件的位置都會累積錯誤。因此，對世界的任何修改都應按以下順序執行： 暫停、重置、修改和保存模擬 。 \n 我們不需要從頭開始創建電子冰球機器人，我們只需要導入一個 E-puck 節點。這個節點其實就是 PROTO 節點，就像我們之前介紹的 RectangleArena 或一樣 WoodenBox 。原型設計可讓您建立自訂物件並重複使用它們。 \n \n 動手操作#5 WoodenBox \xa0 ：選擇場景樹視圖的最後一個節點。按一下場景樹視圖頂部的 Add 按鈕。 在對話框中選擇 PROTO nodes (Webots Projects) / robots / gctronic / e-puck / E-puck (Robot) 。電子冰上曲棍球機器人應該會出現在競技場的中央。移動並旋轉這個機器人，就像移動和旋轉盒子一樣。儲存模擬並按下 Run real-time 按鈕 。 \n \n 機器人應該移動、LED 閃爍並避開障礙物。這是因為它有一個具有該行為的預設控制器。您可能已經注意到 3D 視圖左上角出現了一個小黑視窗。它顯示了電子冰球機器人的 攝影機 拍攝的影像。該影像將保持黑色，直到機器人控制器明確啟用攝影機。可以透過拖曳來 移動 這個小圖像視窗。也可以拖曳右下角來 調整大小 。最後，點擊右上角的「x」即可關閉。您可以透過在 「覆蓋」選單中的 「相機裝置 」子選單中選擇它，使其再次可見。因為我們不需要它，所以您實際上可以關閉它。 \n 影片 \n \n', 'tags': '', 'url': 'w5.html'}, {'title': 'task5', 'text': '2.請整理 \xa0 https://cyberbotics.com/doc/guide/introduction-to-webots \xa0 中重要的英文單字與用法, 並且針對其中所使用的英文文法逐句說明. \n \n \n Mobile robot simulation （移動機器人模擬） \n 差異 ：英文中的「simulation」指的是在虛擬環境中模擬機器人行為，而中文「模擬」同樣表示模仿，但在某些語境下，可能沒有英文「simulation」那麼強烈的虛擬環境暗示。 \n \n Rapid prototyping （快速原型設計） \n 差異 ：英文「prototyping」具體指「製作原型」這個過程，而中文「原型設計」更偏向結果導向，較少強調「製作過程」的含義。 \n \n Physics properties （物理屬性） \n 差異 ：英文「properties」除了「屬性」，也可以指物理環境中的具體特徵和參數，而中文的「屬性」更多強調事物的性質，而不一定包含具體數值。 \n \n Locomotion schemes （移動方式） \n 差異 ：英文「locomotion」特指機器人或動物的移動方式，包括步行、飛行等具體方式；而中文「移動」泛指動作，涵蓋範圍更廣泛。英文「schemes」強調設計、計劃的結構，但中文「方式」沒有強烈的規劃意味。 \n \n Controller program （控制程式） \n 差異 ：英文「controller」強調設備或程式的控制功能，而中文「控制」可能更多指行為，而非具體裝置。 \n \n Robot models （機器人模型） \n 差異 ：英文「model」不僅指模型，還可以包含系統設計的概念，而中文「模型」更偏向於外形或結構，缺乏英文中「概念模型」的深層意義。 \n \n Swarm intelligence （群體智能） \n 差異 ：英文「swarm」特指動物或機器人的群體行動，並且有合作與集體行為的含義，而中文「群體」也可指單純的個體聚集，未必強調合作。 \n \n Genetic algorithm （遺傳算法） \n 差異 ：英文「genetic」在此術語中引用遺傳學理論，而中文「遺傳」通常與生物學相關，在技術環境下可能需要具體說明該算法如何模仿生物遺傳過程。 \n \n Neural networks （神經網絡） \n 差異 ：英文中的「neural」源於生物神經系統，並引申至機器學習模型，而中文「神經」更多指生物概念，除非在明確的技術背景下才會引申至計算領域。 \n \n Artificial intelligence (AI) （人工智能） \n 差異 ：英文「artificial intelligence」是技術術語，指模擬人類智能的系統，中文「人工智能」直接翻譯，但中文的「人工」有時強調「人為」製造，可能略有不同的語感。 \n \n \n Supervisor controller （監督者控制程式） 差異 ：英文「supervisor」在此指具有高級管理功能的控制器，而中文「監督者」更多強調「人」的角色，控制程式翻譯時可能會弱化其技術層面的管理權限含義。 \n \n \n Multi-agent research （多智能體研究） 差異 ：英文「agent」具備自主行為或決策功能，中文「智能體」強調的是智能或行動個體，但「體」的翻譯可能較模糊，沒有完全涵蓋英文中「agent」的主動性和自決性。 \n \n \n Simulation control （模擬控制） 差異 ：英文「simulation」強調在虛擬或模擬環境中的控制，而中文「模擬控制」雖然意義相同，但「模擬」一詞在某些語境下會與「模仿」混淆。 \n \n \n 3D virtual worlds （3D 虛擬世界） 差異 ：英文「virtual worlds」通常指的是由電腦生成的虛擬環境，而中文「虛擬世界」在非技術環境中也可能指非現實的想像世界，因此技術語境中需要強調其數位屬性。 \n \n \n', 'tags': '', 'url': 'task5.html'}, {'title': 'task', 'text': '', 'tags': '', 'url': 'task.html'}, {'title': 'Homework', 'text': '作業 (30%) \n HW1 (5%):  建立由 Box 組成的平面四連桿機構 Webots 模擬場景 \n part1: \n 請各學員在 USB 隨身碟或個人電腦上完成 cd2025 課程所需的可攜系統配置: \n 下載  portable_wcm2025.7z  (330MB, 解開壓縮後 1.4GB) \n Webots_2025a.7z  (1.5 GB, 解開後約為 2.9GB, 可單獨運作) \n Webots_2025a_web.7z  (171 MB, 解開壓縮後約為 1GB, 必須連網運作) \n Blender4.2.7z \n part2: \n 請各學員完成可攜程式系統配置後, 利用 Webots R2025a 中寬度與高度都為 0.1m 的 box 物件建立一個簡單的平面四連桿機構模擬場景. \n base (基座) 長度 1m, link1 長度 0.4m, link2 長度 0.6m, link3 長度 0.9m, 各轉軸均為 HingeJoint, joint1 旋轉速度設定為 1radian/sec. \n part3: \n 模擬場景啟動後, 按下 s 鍵機構開始作動, 按下 p 鍵後機構暫停. \n 參考資料: \n cd2025_hw1_demo.7z \n HW2 (5%):  建立由 CAD 繪製零件組成的平面四連桿機構 Webots 模擬場景 \n 各學員請利用 CAD 系統依據 HW1 的連桿尺寸與運動方式, 配置適當大小的旋轉軸以及基座後, 利用 Webots R2025a 完成一個簡單的平面四連桿機構模擬場景. \n 參考資料: \n fourbar_slvs.7z \n HW3 (20%): 建立 Webots 桌上籃球遊戲機模擬系統 \n 請各分組利用CAD 系統建立一個能在電腦桌 (1600W X 700D X 740H mm) 上運作的投籃機構 ( 參考影片 )後, 導入 Webots R2025a 套件, 建立一個能由使用者透過鍵盤按鍵操作, 且具備計分板的籃球遊戲機模擬系統. \n 參考資料: \n 參考資料: \n fourbar_ball_throwing_linkage.slvs \n sixbar_ball_throwing_linkage.slvs \n \n', 'tags': '', 'url': 'Homework.html'}, {'title': 'HW1', 'text': 'HW1 (5%):  建立由 Box 組成的平面四連桿機構 Webots 模擬場景 \n 操作影片標題: 國立虎尾科技大學 - 機械設計工程系 - cd2025 HW1 - 學員學號 \n \n', 'tags': '', 'url': 'HW1.html'}, {'title': 'HW2', 'text': 'HW2 (5%):  建立由 CAD 繪製零件組成的平面四連桿機構 Webots 模擬場景 \n 操作影片標題: 國立虎尾科技大學 - 機械設計工程系 - cd2025 HW2 - 學員學號 \n \n', 'tags': '', 'url': 'HW2.html'}, {'title': 'HW3', 'text': 'HW3 (20%): 建立 Webots 桌上籃球遊戲機模擬系統 \n 操作影片標題: 國立虎尾科技大學 - 機械設計工程系 - cd2025 HW3 - 學員學號 \n \n', 'tags': '', 'url': 'HW3.html'}, {'title': 'Midterm', 'text': '本課程所繳交的期中成績為學員自評之學習期望成績. \n 期中考週的自評期望成績繳交流程: \n \n 整理先前所完成的各週的進度、作業網頁內容以及心得 \n 拍攝期中自評影片, 上傳至 Youtube 後, 以" 國立虎尾科技大學 - 機械設計工程系 - cd2025 期中自評- 學員學號 "為影片標題後嵌入本頁面中 \n 回填期中自評表單 \n 上傳學員期中成績 \n \n 各週進度: \n 各週網頁內容: \n 期中心得: \n 期中自評影片: \n \n \n', 'tags': '', 'url': 'Midterm.html'}, {'title': 'Exam', 'text': 'Exam1 (10%): 建立 Webots 基本物件模擬場景 \n 各學員利用 Webots R2025a 套件中的 Shape 物件, 隨堂建立指定的機電系統模擬場景, 並利用 Python 程式進行互動控制. \n Exam2 (10%): 利用 CAD 零組件建立模擬場景\xa0 \n 各學員利用 CAD (Solvespace 與 NX2312), 隨堂建立指定的系統模型零組件後, 導入 Webots R2025a 後, 建立機電系統模擬場景, 並利用 Python 程式進行互動控制. \n Exam3 (20%): Webots 機電模擬場景的協同設計 \n 各分組利用 CAD (Solvespace 與 NX2312), 隨堂建立指定的系統模型零組件後, 導入 Webots R2025a 後, 建立機電系統模擬場景, 並利用 Python 程式進行互動控制. 過程中各學員必須採同步協同模式, 維護從 Github Classroom 取得的分組協同倉儲以及網站. \n 協同分組方式: \n \n 分配學員負責利用 Solvespace 建立系統零組件, 過程中必須將所建構之零組件檔案與繪圖過程影片上傳至分組網頁. \n 分配學員負責利用 NX2312 建立系統零組件, 過程中必須將所建構之零組件檔案與繪圖過程影片上傳至分組網頁. \n 分配學員負責利用 Webots 建立機電系統模擬場景, 並利用 Python 程式進行控制, 過程中必須將建構過程拍成帶有說明字幕的影片上傳至分組網頁. \n \n', 'tags': '', 'url': 'Exam.html'}, {'title': 'Exam1', 'text': 'Exam1 (10%): 建立 Webots 基本物件模擬場景 \n 操作影片標題: 國立虎尾科技大學 - 機械設計工程系 - cd2025 Exam1 - 學員學號 \n', 'tags': '', 'url': 'Exam1.html'}, {'title': 'Exam2', 'text': 'Exam2 (10%): 利用 CAD 零組件建立模擬場景 \n 操作影片標題: 國立虎尾科技大學 - 機械設計工程系 - cd2025 Exam2 - 學員學號 \n', 'tags': '', 'url': 'Exam2.html'}, {'title': 'Exam3', 'text': 'Exam3 (20%): Webots 機電模擬場景的協同設計 \n 操作影片標題: 國立虎尾科技大學 - 機械設計工程系 - cd2025 Exam3 - 學員學號 \n', 'tags': '', 'url': 'Exam3.html'}, {'title': 'Final', 'text': '期末協同專案執行過程影片、簡報與 PDf 報告檔案 (六人一組) (30%) \n 題目:  Webots 動態投籃模擬系統的協同設計 \n 說明:  \n 籃框架被配置在一定範圍內, 可隨機慢速前進、後退及左右擺動, 投籃機構系統帶有一定數量的籃球, 被配置在可自由移動的輪車上. \n 操作者可利用鍵盤特定按鍵控制投籃輪車的移動並發射投籃, 每投出一球後系統透過記分板進行計分, 並由送球機構進行補球或移動輪車取球, 遊戲可進行至全部數量籃球投完為止. \n 請將期末協同專案執行過程、內容與心得, 製作成影片，配合字幕上傳至 Youtube 後嵌入各階段的期末報告頁面中. \n 影片標題:  國立虎尾科技大學 - 機械設計工程系 - cd2025 期末報告 - 學員學號 - 各階段影片主題 \n', 'tags': '', 'url': 'Final.html'}, {'title': 'Brython', 'text': '1 add to 100 \n  導入 brython 程式庫  \n \n \n \n \n  啟動 Brython  \n \n \n \n  導入 FileSaver 與 filereader  \n \n \n \n \n  導入 ace  \n \n \n \n \n \n \n  導入 gearUtils-0.9.js Cango 齒輪繪圖程式庫  \n \n \n \n \n \n \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src1"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n \n \n \n  add 1 to 100 開始  \n \n \n  add 1 to 100 結束 \n  editor1 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor1 結束   ##########################################  \n 從 1 累加到 100 part2: \n 1 add to 100 cango_three_gears BSnake AI Tetris \n  請注意, 這裡使用 Javascript 將 localStorage["kw_py_src2"] 中存在近端瀏覽器的程式碼, 由使用者決定存檔名稱 \n \n \n \n  add 1 to 100 part2 開始  \n \n \n  add 1 to 100 part2 結束 \n  editor2 開始  \n  用來顯示程式碼的 editor 區域  \n \n  以下的表單與按鈕與前面的 Javascript doSave 函式以及 FileSaver.min.js 互相配合  \n  存擋表單開始  \n Filename:  .py   \n  存擋表單結束  \n \n  執行與清除按鈕開始  \n Run   Output   清除輸出區 清除繪圖區 Reload \n  執行與清除按鈕結束  \n \n  程式執行 ouput 區  \n \n  Brython 程式執行的結果, 都以 brython_div1 作為切入位置  \n \n  editor2 結束  \n \n \n', 'tags': '', 'url': 'Brython.html'}]};